import { Grid } from "@material-ui/core";
import React from "react";
import "./styles.css";



export default function QuestionEditor() {

  return (
    <Grid xs={7}>
      <div id="quiz">
        <h1>Editor (TODO)</h1>

        <button id="submit-button">Question</button>
        <input id="input-1" type="text" placeholder="name" />

        <button id="next-question-button">Answers</button>

        <div id="quiz-results">
          <p id="quiz-results-message"></p>
          <p id="quiz-results-score"></p>
        </div>

      </div>
    </Grid>
  );

}
